import React from 'react'
import banner from '../../../asset/image/clientbanner.webp'

export default function Client() {
  return (
    <div>
      <div className='grid grid-cols-2'>
        <div>
            <img src={banner} alt='banner' className='w-full h-full object-cover'/>
        </div>
      </div>
    </div>
  )
}
